import React from "react";
import { render } from "react-dom";
import Home from "./components/Home";
import SignIn from "./components/SignIn";
import "./index.css";

const App = () => {
  return (
    <div>
      <Home />
      <SignIn />
    </div>
  );
};

render(<App />, document.getElementById("root"));
